import React, { useState } from 'react';

const Dashboard = () => {
  const totalCustomers = 0;
  const totalBookings = 0;
  const totalProducts = 0;

  const [showProductDropdown, setShowProductDropdown] = useState(false);

  const toggleDropdown = () => {
    setShowProductDropdown(!showProductDropdown);
  };

  const styles = {
    dashboard: {
      textAlign: 'center',
      padding: '20px'
    },
    header: {
      backgroundColor: '#333',
      padding: '100px',
      color: 'white'
    },
    nav: {
      display: 'flex',
      justifyContent: 'center',
      marginBottom: '20px',
      position: 'relative' // Added for dropdown positioning
    },
    navLink: {
      color: 'white',
      margin: '0 15px',
      textDecoration: 'none',
      position: 'relative'
    },
    dropdownMenu: {
      position: 'absolute',
      top: '100%',
      backgroundColor: '#333',
      borderRadius: '8px',
      display: showProductDropdown ? 'block' : 'none',
      padding: '10px',
      zIndex: 1
    },
    dropdownItem: {
      color: 'white',
      padding: '24px 12px',
      textDecoration: 'none',
      display: 'block'
    },
    metrics: {
      display: 'flex',
      justifyContent: 'space-around',
      margin: '40px 0'
    },
    metric: {
      backgroundColor: '#f4f4f4',
      padding: '20px',
      borderRadius: '8px',
      width: '150px'
    },
  };

  return (
    <div style={styles.dashboard}>
      <header style={styles.header}>
        <h1>Online Medical Shop Admin</h1>
        <nav style={styles.nav}>
          <a href="Home" style={styles.navLink}>Home</a>
          <a href="#" style={styles.navLink}>View User</a>
          <a href="#" style={styles.navLink}>View Booking</a>
          <a href="#" style={styles.navLink}>View Feedback</a>
          
          <div style={styles.navLink} onClick={toggleDropdown}>
            Products ▼
            <div style={styles.dropdownMenu}>
              <a href="#" style={styles.dropdownItem}>Add Product</a>
              <a href="#" style={styles.dropdownItem}>View Product</a>
            </div>
          </div>

          <a href="#" style={styles.navLink}>Category</a>
          <a href="#" style={styles.navLink}>Logout</a>
        </nav>
      </header>

      <div style={styles.metrics}>
        <div style={styles.metric}>
          <h2>Total Customer</h2>
          <p>{totalCustomers}</p>
        </div>
        <div style={styles.metric}>
          <h2>Total Booking</h2>
          <p>{totalBookings}</p>
        </div>
        <div style={styles.metric}>
          <h2>Total Product</h2>
          <p>{totalProducts}</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
